var transports = {};
function createMcpServer() {
  const server = new McpServer({
    name: "production-mcp-server",
    version: "1.0.0"
  }, {
    debouncedNotificationMethods: [
      "notifications/tools/list_changed",
      "notifications/resources/list_changed",
      "notifications/prompts/list_changed"
    ]
  });
  server.registerTool("star-wars-info", {
    title: "Star Wars Information",
    description: "Get information about Star Wars films, characters, planets, starships, vehicles, and species from SWAPI",
    inputSchema: {
      resource: exports_external.enum(["films", "people", "planets", "species", "starships", "vehicles"]).describe("Type of Star Wars resource to query"),
      id: exports_external.number().optional().describe("Specific ID to get individual resource (omit to get all)"),
      search: exports_external.string().optional().describe("Search term to filter results by name")
    }
  }, async ({ resource, id, search }) => {
    try {
      let url = `https://swapi.info/api/${resource}`;
      if (id) {
        url += `/${id}`;
      } else if (search) {
        url += `?search=${encodeURIComponent(search)}`;
      }
      const response = await fetch(url);
      if (!response.ok) {
        throw new Error(`HTTP ${response.status}: ${response.statusText}`);
      }
      const data = await response.json();
      let formattedData;
      if (data.results) {
        formattedData = `Found ${data.count} results for ${resource}:

`;
        data.results.forEach((item, index) => {
          formattedData += `${index + 1}. ${item.name || item.title}
`;
          if (item.episode_id)
            formattedData += `   Episode: ${item.episode_id}
`;
          if (item.birth_year)
            formattedData += `   Birth Year: ${item.birth_year}
`;
          if (item.climate)
            formattedData += `   Climate: ${item.climate}
`;
          if (item.model)
            formattedData += `   Model: ${item.model}
`;
          if (item.classification)
            formattedData += `   Classification: ${item.classification}
`;
          formattedData += `
`;
        });
      } else {
        formattedData = `${resource.charAt(0).toUpperCase() + resource.slice(1)} Information:

`;
        formattedData += `Name: ${data.name || data.title}
`;
        if (data.episode_id)
          formattedData += `Episode: ${data.episode_id}
`;
        if (data.director)
          formattedData += `Director: ${data.director}
`;
        if (data.release_date)
          formattedData += `Release Date: ${data.release_date}
`;
        if (data.birth_year)
          formattedData += `Birth Year: ${data.birth_year}
`;
        if (data.height)
          formattedData += `Height: ${data.height}cm
`;
        if (data.mass)
          formattedData += `Mass: ${data.mass}kg
`;
        if (data.hair_color)
          formattedData += `Hair Color: ${data.hair_color}
`;
        if (data.eye_color)
          formattedData += `Eye Color: ${data.eye_color}
`;
        if (data.gender)
          formattedData += `Gender: ${data.gender}
`;
        if (data.diameter)
          formattedData += `Diameter: ${data.diameter}km
`;
        if (data.climate)
          formattedData += `Climate: ${data.climate}
`;
        if (data.terrain)
          formattedData += `Terrain: ${data.terrain}
`;
        if (data.population)
          formattedData += `Population: ${data.population}
`;
        if (data.model)
          formattedData += `Model: ${data.model}
`;
        if (data.manufacturer)
          formattedData += `Manufacturer: ${data.manufacturer}
`;
        if (data.cost_in_credits)
          formattedData += `Cost: ${data.cost_in_credits} credits
`;
        if (data.length)
          formattedData += `Length: ${data.length}m
`;
        if (data.crew)
          formattedData += `Crew: ${data.crew}
`;
        if (data.passengers)
          formattedData += `Passengers: ${data.passengers}
`;
        if (data.classification)
          formattedData += `Classification: ${data.classification}
`;
        if (data.designation)
          formattedData += `Designation: ${data.designation}
`;
        if (data.average_height)
          formattedData += `Average Height: ${data.average_height}cm
`;
        if (data.language)
          formattedData += `Language: ${data.language}
`;
        if (data.opening_crawl)
          formattedData += `
Opening Crawl:
${data.opening_crawl}
`;
      }
      return {
        content: [{
          type: "text",
          text: formattedData
        }]
      };
    } catch (error) {
      return {
        content: [{
          type: "text",
          text: `Error fetching Star Wars data: ${error instanceof Error ? error.message : "Unknown error"}`
        }],
        isError: true
      };
    }
  });
  return server;
}
app.post("/mcp", async (req, res) => {
  const sessionId = req.headers["mcp-session-id"];
  let transport;
  try {
    if (sessionId && transports[sessionId]) {
      transport = transports[sessionId];
    } else if (!sessionId && isInitializeRequest(req.body)) {
      transport = new StreamableHTTPServerTransport({
        sessionIdGenerator: () => randomUUID(),
        onsessioninitialized: (sessionId2) => {
          transports[sessionId2] = transport;
          console.log(`\uD83D\uDCF1 New session initialized: ${sessionId2}`);
        },
        enableDnsRebindingProtection: Bun.env.NODE_ENV === "production",
        allowedHosts: Bun.env.NODE_ENV === "production" ? ["yourdomain.com", "www.yourdomain.com"] : ["127.0.0.1", "localhost"]
      });
      transport.onclose = () => {
        if (transport.sessionId) {
          console.log(`\uD83D\uDDD1️ Session closed: ${transport.sessionId}`);
          delete transports[transport.sessionId];
        }
      };
      const server = createMcpServer();
      await server.connect(transport);
    } else {
      res.status(400).json({
        jsonrpc: "2.0",
        error: {
          code: -32000,
          message: "Bad Request: No valid session ID provided"
        },
        id: null
      });
      return;
    }
    await transport.handleRequest(req, res, req.body);
  } catch (error) {
    console.error("❌ Error handling MCP request:", error);
    if (!res.headersSent) {
      res.status(500).json({
        jsonrpc: "2.0",
        error: {
          code: -32603,
          message: "Internal server error"
        },
        id: null
      });
    }
  }
});
app.get("/mcp", async (req, res) => {
  const sessionId = req.headers["mcp-session-id"];
  if (!sessionId || !transports[sessionId]) {
    res.status(400).send("Invalid or missing session ID");
    return;
  }
  const transport = transports[sessionId];
  await transport.handleRequest(req, res);
});
